import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    state = {
        listings: []
    }

    componentDidMount()
    {
        var contents = readFileSync(raw, 'utf-8');

        listings = contents.split(/\r?\n/);

    }

    render()
    {
        return (
            <ul>
                {
                    this.state.listings
                        .map(listing =>
                            <li key={listing.FirstName}>{listing.LastName}</li>
                        )
                }
            </ul>
        );
    }


}
